import LogItem from "./LogItem";
import "../Logs/Logs.css" ;
import Card from "../UI/Card";

const Logs = (props) =>{

      

    const logItemData = props.logsData.map(item => <
         LogItem onDelete={props.onDelete} 
         key ={item.id}
         date={item.date} 
         desc={item.desc} 
         time ={item.time} />)

    return <Card className="logs"> 
    

        {logItemData}
        {/* <LogItem/>
        <LogItem/>
        <LogItem/>
        <LogItem/> */}
        </Card>

    


};

export default Logs;
